import React from 'react';
import { Draggable } from 'react-beautiful-dnd';

const item = (props) => {

    const {task, index} = props;
    return (
        <Draggable draggableId={task.id} index={index}>
            <p>{task.content}</p>
        </Draggable>
    );
}

export default item;
